import React from "react";

const QuotationManager = () => {
  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Quotation Manager</h2>
      <p>Quotation management functionality will be implemented here.</p>
    </div>
  );
};

export default QuotationManager;
